  false,\n\t\"url\": null,\n\t\"notes\": \"This public hunting and fishing plan for
  Tewaukon National Wildlife Refuge explains the primary wildlife management objectives
  for: waterfowl, migratory birds other than waterfowl, big game and upland game birds.
  The role of refuge on a flyway management basis is indicated in the plan. Refuge
  size and development, utilization by waterfowl and public reactions are also described.
  The section on hunting of resident game species indicates white-tail deer is the
  only species recommended for harvest.  The section on fishing explicates the fishery
  management program, the effects on waterfowl and justification for fishing at Tewaukon
  NWR.  Maps are included for public hunting recommendations and public fishing recommendations.\",\n\t\"license_title\":
